import React from 'react'
import "./filter.scss"

const Filter = (props) => {

    const { filterByConsumer, filterByConsultant, filterByEmployed } = props;

    return (
        <div>
            <label>Filter by Consumer</label>
            <input type="text" />

            <label>Filter by Consultant</label>
            <input checked={checkboxConsultant}
	            onChange={() => setCheckboxConsultant(!checkboxConsultant)}
	            type="checkbox"/>

            <label>Employed?</label>
            <input checked={checkboxEmployed}
	            onChange={() => setCheckboxEmployed(!checkboxEmployed)}
	            type="checkbox"/>
        </div>
    )
}

export default Filter
